import {Menu} from 'antd';

const Navbar = () =>{
    return(
        <div>
            <Menu 
            style={{ height: 100, paddingInline: 50, lineHeight: '64px', top}}
            mode='horizontal'
            items={[
                {
                    label: 'Home',
                    key:'home',
                }, {
                    label: 'Contact us',
                    key:'contact',
                }, {
                    label: 'About us',
                    key:'about',
                }, {
                    label: 'Login',
                    key:'login',
                }

            ]}
            >
            </Menu>
        </div>
    );
};

export default Navbar;
